import React from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import './HomePage.css'; // Import file CSS riêng cho HomePage

const HomePage = () => {
  return (
    <div className="homepage-container">
      <header className="header">
        <h1>Quản lý cửa hàng</h1>
      </header>
      <nav className="navbar">
        <ul>
          <li><Link to="/nhap-hang">Nhập hàng</Link></li>
          <li><Link to="/quan-ly-kho">Quản lý kho hàng</Link></li>
          <li><Link to="/quan-ly-don-hang">Quản lý đơn hàng</Link></li>
          <li><Link to="/doanh-thu">Doanh thu</Link></li>
        </ul>
      </nav>
      <main className="main-content">
        <Routes>
          <Route path="/nhap-hang" element={<NhapHang />} />
          <Route path="/quan-ly-kho" element={<QuanLyKho />} />
          <Route path="/quan-ly-don-hang" element={<QuanLyDonHang />} />
          <Route path="/doanh-thu" element={<DoanhThu />} />
        </Routes>
      </main>
    </div>
  );
};

const NhapHang = () => (
  <section>
    <h2>Nhập hàng</h2>
    <p>Thông tin về nhập hàng...</p>
  </section>
);

const QuanLyKho = () => (
  <section>
    <h2>Quản lý kho hàng</h2>
    <p>Thông tin về quản lý kho hàng...</p>
  </section>
);

const QuanLyDonHang = () => (
  <section>
    <h2>Quản lý đơn hàng</h2>
    <p>Thông tin về quản lý đơn hàng...</p>
  </section>
);

const DoanhThu = () => (
  <section>
    <h2>Doanh thu</h2>
    <p>Thông tin về doanh thu...</p>
  </section>
);

export default HomePage;
